const contentful = require('contentful-management')

const client = contentful.createClient({
  space: 'ewad646po7qh',
  accessToken: 'tg_dpGwYe00ipl7GADfPRwoTwgVBYq2kUx77P5FKlVk'
})

client.getEntries()
.then((response) => console.log(response.items))
.catch(console.error)
